import React, { useEffect, useState } from 'react';
import { useParams, Link, useLocation } from 'react-router-dom';
import '../styles/BusinessProfile.css';

const BusinessProfile = () => {
  const { id } = useParams();
  const location = useLocation();
  const [business, setBusiness] = useState(null);
  
  useEffect(() => {
    // Get business data from location state if available
    if (location.state && location.state.business) {
      setBusiness(location.state.business);
    } else {
      // If no business data in state, you could fetch it from API using the ID
      console.log(`Would fetch business with ID: ${id}`);
      // For demo purposes, set a placeholder business
      setBusiness({
        id: id || '1',
        BusinessName: 'The Farm at Southern Oregon University',
        BusinessType: 'Agricultural Association',
        Address: 'Southern Oregon University, Ashland, OR',
        Phone: '(555) 123-4567',
        Email: 'farm@sou.edu',
        Website: 'https://farm.sou.edu',
        Description: 'The Farm at Southern Oregon University is a center for sustainability. The student-led organic farm is a hub for education, student and faculty research, and community engagement with the Rogue Valley.',
        Country: 'USA',
        State: 'Oregon'
      });
    }
  }, [id, location]);

  if (!business) {
    return <div className="loading">Loading business details...</div>;
  }

  return (
    <div className="business-profile-container">
      <div className="profile-header">
        <h1>{business.BusinessName}</h1>
        <p className="business-type">{business.BusinessType}</p>
      </div>

      <div className="profile-content">
        <div className="profile-section">
          <div className="profile-main">
            <div className="profile-image-container">
              <img 
                src="/farm-image.jpg" 
                alt={business.BusinessName} 
                className="profile-image"
                onError={(e) => {
                  e.target.onerror = null;
                  e.target.src = "https://farm.sou.edu/wp-content/uploads/sites/12/2017/12/TheFarm_Banner-1.jpg";
                }} 
              />
            </div>

            <div className="profile-details">
              <h2>Who We Are</h2>
              <p>{business.Description || 'No description available.'}</p>
              
              <div className="contact-info">
                <h3>Contact Information</h3>
                {business.Address && <p><strong>Address:</strong> {business.Address}</p>}
                {business.Phone && <p><strong>Phone:</strong> {business.Phone}</p>}
                {business.Email && <p><strong>Email:</strong> <a href={`mailto:${business.Email}`}>{business.Email}</a></p>}
                {business.Website && (
                  <p>
                    <strong>Website:</strong>{' '}
                    <a 
                      href={business.Website.startsWith('http') ? business.Website : `https://${business.Website}`}
                      target="_blank"
                      rel="noopener noreferrer"
                    >
                      {business.Website}
                    </a>
                  </p>
                )}
                <p><strong>Location:</strong> {business.State}, {business.Country}</p>
              </div>
            </div>
          </div>

          <div className="profile-sections">
            <div className="profile-section-card">
              <h3>Partnerships & Programs</h3>
              <p>
                Above anything else, The Farm at SOU is proud to be an education hub for sustainability. From student workers, kids programs, college courses, we aim to educate the next generation of land stewards.
              </p>
            </div>

            <div className="profile-section-card">
              <h3>Support The Farm</h3>
              <p>
                One of the most common questions we receive on farm tours is "what do you do with the food?" Our organic, nutrient dense vegetables are sold to CSA members, Ashland School District, and SOU's dining facilities.
              </p>
            </div>
          </div>
        </div>

        <div className="contact-form">
          <h2>Contact Us</h2>
          <form>
            <div className="form-group">
              <input type="text" placeholder="Name" required />
            </div>
            <div className="form-group">
              <input type="email" placeholder="Email" required />
            </div>
            <div className="form-group">
              <textarea placeholder="Message" rows="4" required></textarea>
            </div>
            <button type="submit" className="send-button">Send</button>
          </form>
        </div>
      </div>

      <div className="back-link">
        <Link to={`/directory/${business.BusinessType?.toLowerCase().replace(/\s+/g, '-')}`}>
          &larr; Back to Directory
        </Link>
      </div>
    </div>
  );
};

export default BusinessProfile;
